        // Create collection animation before removing the pierogi
        this.tweens.add({
            targets: pierogi,
            scaleX: 1.5,
            scaleY: 1.5,
            alpha: 0,
            duration: 200,
            ease: 'Power2',
            onComplete: () => {
                this.pierogies.killAndHide(pierogi);
                pierogi.destroy();
